        stampedName: stamp-component-stamped-name-syndicate
      content: >-
        [bold]GUNNER INSTRUCTION GUIDELINES:[/bold]


        This instruction manual is to prepare you for use of the GLX-225's armament systems.


        [bold]Ammuniton lockers:[/bold]

        Marked by yellow tiling, ammunition lockers should remain

        closed when possible, as loose items may be flung.

        [bold]IMPORTANT![/bold]

        Do not waste ammunition, especially not on the target

        station! You are to kill the station's air defence and then

        board to neutralize it with the nuclear warhead.


        [bold]EXP-1200 "DUSTER" Cannons:[/bold]

        Must be loaded manually.

        The ammo can be found in ammo storage lockers marked

        by yellow tiling.


        [bold]Handheld mass scanners:[/bold]

        Use these devices to time your shots correctly, and keep

        in mind the time it takes your projectile to travel. Do not

        attempt to board the enemy vessels, as you are much more

        vulnerable in space than you are behind three layers of

        plastitanium


        Glory to Gorlex.
