  - uid: 1351
    components:
    - type: Transform
      pos: 1.4827995,-12.509884
      parent: 1
    - type: Paper
      stampState: paper_stamp-syndicate
      stampedBy:
      - stampedColor: '#850000FF'
        stampedName: stamp-component-stamped-name-syndicate
      content: >-
        [bold]COMBAT ENGINEER GUIDELINE MANUAL:[/bold]


        You are responsible for the continued maintenance and, if need be, replacement of vital machinery destroyed in combat.


        [bold]External capabilities:[/bold]


        You will find that you have been given a jetpack, handheld mass scanner, and magboots. You are to carefully use these tools to fix harder to reach locations on the shuttle, although we encourage you to use or build lattice where possible as to not become thrown off in combat.


        [bold]Replacement parts:[/bold]


        You have been supplied with a multitude of flatpacks, which you are expected to use for the replacement of destroyed machinery. NOT FOR SHUTTLE UPGRADES.


        You are not to use your equipment for boarding, as doing so would likely result in the loss of the shuttle's valuable engineer.


        Glory to Gorlex.
  - uid: 1353
    components:
    - type: Transform
      pos: 6.8245835,22.486012
      parent: 1
    - type: Paper
      stampState: paper_stamp-syndicate
      stampedBy:
      - stampedColor: '#850000FF'
        stampedName: stamp-component-stamped-name-syndicate
      content: >-
        [bold]TO THE ESTEEMED CAPTAIN ASSIGNED TO GLX-225:[/bold]


        You have been entrusted with a heavily armored dreadnought of vast value.


        [bold]Goal:[/bold]


        You are to eliminate the station's air defences, if any, and then board with your crew to detonate the station with the nuclear warhead. Do not waste ammunition shooting at the station. Take note of gun locations.


        [bold]Equipment:[/bold]


        In your locker you will find an important set of gear. Use your headset to communicate with your crew, and prevent damage to yourself and this shuttle how possible.


        The remote found on the opposing table is connected to the shutters around your seating area, should you need more protection from boarders.


        [bold]Communications:[/bold]


        Remember, communication with your crew is key! Their needs are yours, and you should ensure they are aware of this before entering combat.


        [bold]Do not use this shuttle for ramming. It will not work, and it has guns for a reason. You were employed for your competence, prove us correct.[/bold]


        Glory to Gorlex.
